import style from "../main/MainThing.module.scss";



export const AnimatedTitle = () => {
    return (
        <motion.h1

            className={style.Title}>Поможем принять для вас денежные средства в РФ. Для ИП и ФИЗ ЛИЦ
        </motion.h1>
    )
}
